"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Androgens and other hormones to boost sports performance: Risks and side effects (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H99569121\">",
"      <span class=\"h1\">",
"       What are androgens and other hormones to boost sports performance?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Androgens are male sex hormones that are made naturally by the body.",
"     </p>",
"     <p>",
"      Testosterone is the most important androgen. It is the reason men have male sexual features, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Hair on the body and face",
"       </li>",
"       <li>",
"        Large, strong muscles",
"       </li>",
"       <li>",
"        A deep, low voice",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Women also make testosterone but in much lower amounts than men.",
"     </p>",
"     <p>",
"      Androgens can also be made in a lab and are called &ldquo;synthetic androgens.&rdquo; They are also called &ldquo;anabolic steroids,&rdquo; or just &ldquo;steroids.&rdquo;",
"     </p>",
"     <p>",
"      Doctors sometimes prescribe testosterone to men whose bodies don&rsquo;t make enough. It is taken as an injection (shot), as a patch placed on the skin, or a gel rubbed into the skin.",
"     </p>",
"     <p>",
"      Some people (mostly men, but sometimes women) take androgens or other hormones to build up their muscles and perform better in sports. But there are some serious side effects to people who do this.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H99569136\">",
"      <span class=\"h1\">",
"       What are the different types of androgens and other hormones to boost sports performance?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Androgens and other hormones to boost sports performance include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Testosterone &ndash; This is the main androgen made by the body. Doctors agree that it is safe to give testosterone to men who cannot make a normal amount of testosterone on their own. For men with normal testosterone levels, taking extra hormone might help sports performance a little bit. But it can be also harmful.",
"       </li>",
"       <li>",
"        Synthetic androgens &ndash; These include stanozolol and nadrolone, which come in pills.",
"       </li>",
"       <li>",
"        Chemicals that change into androgens in the body &ndash; These include androstenedione (also called &ldquo;andro&rdquo;) and DHEA. Androstenedione used to be sold as an over-the-counter pill. But it is now prescription-only. There is no proof that it makes your muscles stronger. DHEA pills are sold over-the-counter.",
"       </li>",
"       <li>",
"        Chemicals that help to body make more testosterone &ndash; One example is",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?5/28/5574?source=see_link\">",
"         tamoxifen",
"        </a>",
"        , a pill that blocks the female hormone estrogen. Another is human chorionic gonadotropin (also called hCG), a hormone women&rsquo;s bodies make when they are pregnant.",
"       </li>",
"       <li>",
"        Growth hormone &ndash; This hormone normally helps the body grow and build muscle. Doctors prescribe it to people who don&rsquo;t make enough of it. But people who have normal amounts of growth hormone sometimes take extra to try to boost their performance. There is no proof that this works, and it can be harmful.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H99569153\">",
"      <span class=\"h1\">",
"       What are the risks and side effects of steroids to boost sports performance?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Androgens can cause the following side effects:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Liver problems",
"       </li>",
"       <li>",
"        Mood problems, such as being aggressive",
"       </li>",
"       <li>",
"        Too many red blood cells and a higher-than-normal risk of blood clots",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In men, androgens cause the testes to stop making natural testosterone and sperm. They also cause men&rsquo;s breasts to grow (called &ldquo;gynecomastia&rdquo;).",
"     </p>",
"     <p>",
"      In women, androgens cause a deep voice and hair growth on the face and other parts of the body.",
"     </p>",
"     <p>",
"      In teenagers, androgens can cause the ends of certain bones to fuse together earlier than normal.",
"     </p>",
"     <p>",
"      In men, hCG and",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?5/28/5574?source=see_link\">",
"       tamoxifen",
"      </a>",
"      can cause the breasts to swell and grow larger.",
"     </p>",
"     <p>",
"      Growth hormone has many side effects, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Diabetes",
"       </li>",
"       <li>",
"        High blood pressure",
"       </li>",
"       <li>",
"        An enlarged heart",
"       </li>",
"       <li>",
"        Hand swelling",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H99569168\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?17/26/17826?source=see_link\">",
"       Patient information: Growth hormone treatment (The Basics)",
"      </a>",
"     </p>",
