"        </a>",
"       </dd>",
"       <dd>",
"        <a href=\"UTD.htm?27/53/28498\">",
"         Patient information: Preeclampsia (The Basics)",
"        </a>",
"       </dd>",
"       <dt class=\"beyondthebasics\">",
"        Beyond the Basics",
"       </dt>",
"       <dd>",
"        <a href=\"UTD.htm?39/58/40867\">",
"         Patient information: Preeclampsia (Beyond the Basics)",
"        </a>",
"       </dd>",
"      </dl>",
"      <div id=\"tooltipper\">",
"      </div>",
"     </div>",
"    </div>",
"   </div>",
"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: HELLP syndrome (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hellp-syndrome-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H15139976\">",
"      <span class=\"h1\">",
"       What is HELLP syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;HELLP syndrome is a serious condition some women get when they are pregnant. It can cause pain in the upper belly and other symptoms.",
"     </p>",
"     <p>",
"      HELLP syndrome usually happens in the last 3 months of pregnancy. It can also happen earlier, or 1 or 2 days after the baby is born.",
"     </p>",
"     <p>",
"      Some women with HELLP also have another medical problem that happens during pregnancy called &ldquo;preeclampsia.&rdquo; Women with preeclampsia have high blood pressure and too much protein in their urine.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15139991\">",
"      <span class=\"h1\">",
"       What are the symptoms of HELLP syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Belly pain, especially in the upper belly",
"       </li>",
"       <li>",
"        Nausea or vomiting",
"       </li>",
"       <li>",
"        Feeling sick",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140006\">",
"      <span class=\"h1\">",
"       How will HELLP syndrome affect my pregnancy and my baby?",
"      </span>",
"      &nbsp;&mdash;&nbsp;HELLP syndrome can be dangerous for you and your baby. It can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Harm your blood cells, and your liver, kidneys, and other organs",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Harm your placenta -- The placenta is the organ that brings the baby nutrients and oxygen and takes away waste. It might pull away from the uterus before your baby is born. If this happens, your baby might not get all the nutrients and oxygen he or she needs. The placenta pulling away can also cause heavy bleeding that can be dangerous for you and your baby. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Having HELLP syndrome can make it more likely that your baby will:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Be born early -- Being born early can cause babies to have lung, eye, brain, and other problems.",
"       </li>",
"       <li>",
"        Be small",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140023\">",
"      <span class=\"h1\">",
"       Is there a test for HELLP syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. HELLP syndrome causes many changes in the blood. To check for the condition, your doctor or nurse can do a series of blood tests. You might also have other tests, but that is not always necessary.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140040\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if you are pregnant and:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You have belly pain, especially in your upper belly",
"       </li>",
"       <li>",
"        You have nausea and vomiting, especially along with belly pain",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140055\">",
"      <span class=\"h1\">",
"       How is HELLP syndrome treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The only cure for HELLP syndrome is giving birth to the baby. Doctors usually treat the condition by giving women medicines to make them go into labor, even if that means the baby will be born early. In some cases, doctors do a C-section (surgery to get the baby out) instead of giving medicines that cause labor. The risks of having HELLP are worse than the risks of having a baby born early. &nbsp;",
"     </p>",
"     <p>",
"      Doctors sometimes give women medicines called steroids for 2 days before delivering the baby. These medicines speed up the growth of the baby&rsquo;s lungs so he or she can breathe more easily after birth. (The steroid medicines are not the same as the steroids that athletes take to build muscle.)",
"     </p>",
"     <p>",
"      Other treatments might include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Medicines to control high blood pressure",
"       </li>",
"       <li>",
"        Medicines to prevent seizures (preeclampsia can cause seizures)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140070\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you had HELLP syndrome in 1 pregnancy, you could have it again. You also have a higher chance of getting preeclampsia.",
"     </p>",
"     <p>",
"      Before you get pregnant again, see your doctor or nurse for a checkup. Talk with your doctor, nurse, or midwife about HELLP syndrome, preeclampsia, and other health conditions that could affect your next pregnancy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15140085\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?27/53/28498?source=see_link\">",
"       Patient information: Preeclampsia (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?7/32/7682?source=see_link\">",
"       Patient information: High blood pressure and pregnancy (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?16/21/16723?source=see_link\">",
"       Patient information: C-section (cesarean delivery) (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?39/58/40867?source=see_link\">",
"       Patient information: Preeclampsia (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
