"      Peptax (UY);",
"     </li>",
"     <li>",
"      Prepulsid (AE, AT, AU, BE, BF, BG, BH, BJ, BR, CH, CI, CL, CO, CY, DE, DK, EG, ES, ET, FI, FR, GB, GH, GM, GN, IE, IL, IQ, IR, IT, JO, KE, KW, LB, LR, LU, LY, MA, ML, MR, MU, MW, MY, NE, NG, NL, NO, NZ, OM, PH, PT, PY, QA, RU, SA, SC, SD, SE, SL, SN, SY, TN, TR, TZ, UG, YE, ZA, ZM, ZW);",
"     </li>",
