"   <div class=\"block pha drugH1Div\" id=\"F152045\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Enhances the release of acetylcholine at the myenteric plexus.",
"     <i>",
"      In vitro",
"     </i>",
"     studies have shown cisapride to have serotonin-4 receptor agonistic properties which may increase gastrointestinal motility and cardiac rate; increases lower esophageal sphincter pressure and lower esophageal peristalsis; accelerates gastric emptying of both liquids and solids.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F152058\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: 0.5-1 hour",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 97.5% to 98%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic to norcisapride",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 35% to 40%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 6-12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine and feces (&lt;10%)",
"    </p>",
"   </div>",
"  </div>",
