var title_f28_46_29416="Dracunculiasis life cycle";
var content_f28_46_29416=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F79141&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F79141&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 637px\">",
"   <div class=\"ttl\">",
"    Dracunculiasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 617px; height: 467px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Humans become infected by drinking unfiltered water containing copepods (small crustaceans) that are infected with larvae of",
"    <em>",
"     D. medinensis",
"    </em>",
"    <strong>",
"     (1)",
"    </strong>",
"    . Following ingestion, the copepods die and release the larvae, which penetrate the host stomach and intestinal wall and enter the abdominal cavity and retroperitoneal space",
"    <strong>",
"     (2)",
"    </strong>",
"    . After maturation into adults and copulation, the male worms die and the females (length: 70 to 120 cm) migrate in the subcutaneous tissues towards the skin surface",
"    <strong>",
"     (3)",
"    </strong>",
"    . Approximately one year after infection, the female worm induces a blister on the skin, generally on the distal lower extremity, which ruptures. When this lesion comes into contact with water, a contact that the patient seeks to relieve the local discomfort, the female worm emerges and releases larvae",
"    <strong>",
"     (4)",
"    </strong>",
"    . The larvae are ingested by a copepod",
"    <strong>",
"     (5)",
"    </strong>",
"    and after two weeks (and two molts) have developed into infective larvae",
"    <strong>",
"     (6)",
"    </strong>",
"    . Ingestion of the copepods closes the cycle",
"    <strong>",
"     (1)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Dracunculiasis. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Dracunculiasis.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Dracunculiasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
